import { createRouter, createWebHistory } from 'vue-router'

const routes = [
  {
    path: '/list-user',
    name: 'ListUser',
    component: () => import('../views/ListUser.vue')
  },
  {
    path: '/user-profile',
    name: 'UserProfile',
    component: () => import('../views/UserProfile.vue')
  },
  {
    path: '/dashboard',
    name: 'DasboardView',
    component: () => import('../views/DashboardView.vue')
  },
  {
    path: '/list-penyewa',
    name: 'ListPenyewa',
    component: () => import('../views/ListPenyewa.vue')
  },
  {
    path: '/list-pemilik',
    name: 'ListPemilik',
    component: () => import('../views/ListPemilik.vue')
  },
  {
    path: '/status-penyewa',
    name: 'StatusPenyewa',
    component: () => import('../views/StatusPenyewa.vue')
  },
  {
    path: '/tambah-user',
    name: 'TambahUser',
    component: () => import('../views/TambahUser.vue')
  },
  {
    path: '/tambah-penyewa',
    name: 'TambahPenyewa',
    component: () => import('../views/TambahPenyewa.vue')
  },
  {
    path: '/tambah-pemilik',
    name: 'TambahPemilik',
    component: () => import('../views/TambahPemilik.vue')
  },
  {
    path: '/edit-user/:id',
    name: 'EditUser',
    component: () => import('../views/EditUser.vue')
  },
  {
    path: '/edit-pemilik/:id',
    name: 'EditPemilik',
    component: () => import('../views/EditPemilik.vue')
  },
  {
    path: '/edit-penyewa/:id',
    name: 'EditPenyewa',
    component: () => import('../views/EditPenyewa.vue')
  },
  {
    path: '/list-kamar',
    name: 'ListKamar',
    component: () => import('../views/ListKamar.vue')
  },
  {
    path: '/reservasi',
    name: 'ReservasiKamar',
    component: () => import('../views/ReservasiKamar.vue')
  },
  {
    path: '/verifikasi',
    name: 'VerifikasiView',
    component: () => import('../views/VerifikasiView.vue')
  },
  {
    path: '/financial',
    name: 'FinancialView',
    component: () => import('../views/FiancialView.vue')
  }



]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
